import { IconButton, Typography } from "@mui/material";
import Container from '@mui/material/Container';
import Grid from '@mui/material/Unstable_Grid2';
import Box from '@mui/material/Box'
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
const MusicList = (props) => {

  return (
    <>
      <Container mxWidth="sm" >
        <Grid container spacing={0}>
          <Grid xs={12} >
            <Typography variant="h3" fontWeight="bold" component="h2">
              {props.tracks[props.index].name}
            </Typography>


          </Grid>
          <Grid xs={12} sx={{ display: 'flex' }}>
            <Typography variant="body1" fontWeight="bold" component="h2">
            {props.tracks[props.index].artist}
            </Typography>
            <Typography variant="body1" fontWeight="bold" component="h2" sx={{ mx: 2 }}>
              . 2023
            </Typography>
            <Typography variant="body1" fontWeight="bold" component="h2" sx={{ mx: 2 }}>
              . {props.tracks.length}Songs
            </Typography>

          </Grid>
       
       {
          props.tracks.map((song,index)=>{

          return<Grid  key={index} xs={12}  sx={{ p: 1,color: 'black' }}>
            <Box>
              <Typography variant="body1" component="h2"
                sx={{ mx: 1, display: 'flex', justifyContent: 'start',fontWeight:'bold'}}>
                {index+1}. {song.name}- {song.artist}
              </Typography>
            </Box>
          </Grid>})
}
          </Grid>
  </Container>
    </>
  )
}
export default MusicList;
